INSERT INTO `POST` VALUES (2,'Introduces relational database management systems as a class of software systems.'),(3,' Covers design theory, query language, and performance/tuning issues.'),(4,'Includes exercises using a commercial relational or object-relational database management system.'),(6,'Introduces the fundamental problems, theories, and algorithms of the artificial intelligence field. '),(8,'Required course work includes the creation of working programs that solve problems, reason logically.'),(9,'Introduces the fundamentals of two-dimensional and three-dimensional computer graphics, with an emphasis on approaches for obtaining realistic images.'),(12,'Studies rendering of three-dimensional scenes composed of spheres, polygons, quadric surfaces, and bi-cubic surfaces using ray-tracing and radiosity. '),(14,'Introduces fundamental techniques for low-level and high-level computer vision. '),(16,'Discusses models of human vision (gestalt effects, texture perception, subjective contours, visual illusions, apparent motion, mental rotations, and cyclopean vision).'),(17,'Introduces autonomous mobile robots with a focus on algorithms and software development, including closed-loop control, robot software architecture, wheeled locomotion and navigation, tactile and basic visual sensing, obstacle detection and avoidance, and grasping and manipulation of objects. '),(19,'Culminates in a project that connects the algorithms and hardware developed in the course with a selected topic in the current robotics research literature.'),(22,'Covers the principles of human-computer interaction and the design and evaluation of user interfaces. '),(24,' Course work includes both the creation and implementation of original user interface designs, and the evaluation of user interfaces created by others. Requires knowledge of C programming language/UNIX.'),(26,'Studies the basic components of programming languages, specification of syntax and semantics, and description and implementation of programming language features. Discusses examples from a variety of languages.'),(29,'Covers software life cycle models (waterfall, spiral, and so forth), domain engineering methods, requirements analysis methods (including formal specifications), software design principles and methods'),(33,'Focuses on mobile application development on a mobile phone or related platform. Discusses memory management; user interface building, including both MVC principles and specific tools; touch events; data handling, including core data, SQL, XML, and JSON'),(34,'Students are expected to work on a project that produces a professional-quality mobile application and to demonstrate the application that they have developed. The instructor chooses a modern mobile platform to be used in the course.'),(37,'Studies the structure, components, design, implementation, and internal operation of computer systems, focusing mainly on the operating system level. '),(39,'ntroduces distributed operating systems. Discusses issues arising from concurrency and distribution, such as scheduling of concurrent processes, interprocess communication and synchronization, resource sharing and allocation, and deadlock management and resolution.'),(41,'Discusses Web development for sites that are dynamic, data driven, and interactive. Focuses on the software development issues of integrating multiple languages, assorted data technologies, and Web interaction.'),(44,'Considers ASP.NET, C#, HTTP, HTML, CSS, XML, XSLT, JavaScript, AJAX, RSS/Atom, SQL, and Web services. '),(46,'Offers selected readings under the supervision of a faculty member. May be repeated without limit.');
